import React, { useState } from 'react';
import axios from 'axios';
import '../css/f_log.css';

function FacultyLogin() {
    const [showNotification, setShowNotification] = useState(false);
    const [passwordVisible, setPasswordVisible] = useState(false);
    const [fac_id, setFacId] = useState('');
    const [password, setPassword] = useState('');
    const [facIdError, setFacIdError] = useState('');
    const [passError, setPassError] = useState('');

    const togglePassword = () => {
        setPasswordVisible(!passwordVisible);
    };

    const validateFacultyForm = async (e) => {
        e.preventDefault();
        setFacIdError('');
        setPassError('');

        let isValid = true;
        if (fac_id.trim() === '') {
            setFacIdError('Faculty ID is required.');
            isValid = false;
        }
        if (password.trim() === '') {
            setPassError('Password is required.');
            isValid = false;
        } else if (password.length < 6) {
            setPassError('Password must be at least 6 characters.');
            isValid = false;
        }

        if (!isValid) return;

        try {
            const response = await axios.post("http://localhost:5000/api/auth/faculty-login", {
                fac_id,
                password
            });

            localStorage.setItem("token", response.data.token);

            alert("Login successful!");
            window.location.href = "/faculty-dashboard";

        } catch (error) {
            setShowNotification(true);
            setTimeout(() => setShowNotification(false), 3000);
        }
    };

    return (
        <div id="fac_log">
            {showNotification && (
                <div className="notification">
                    <i>⚠️</i>
                    <span>Invalid Faculty ID or Password</span>
                    <span className="close-btn" onClick={() => setShowNotification(false)}>✖</span>
                </div>
            )}

            <nav className="navbar navbar-expand-lg navbar-light fixed-top py-3" id="mainNav">
                <div className="container">
                    <img src="assets/logo.png" alt="logo" width="200px" height="50px" className="logo" />
                </div>
            </nav>

            <div className="c2">
                <div id="heading">
                    <h1>Faculty</h1>
                </div>
                <div className="get_ip">
                    <h2>Log-in</h2>
                    <div className="form" align="center">
                        <form id="FacultyForm" onSubmit={validateFacultyForm}>
                            <span className="error">{facIdError}</span>
                            <input
                                type="text"
                                id="fac_id"
                                placeholder="Faculty ID"
                                name="fac_id"
                                value={fac_id}
                                onChange={(e) => setFacId(e.target.value)}
                            /><br />

                            <span className="error">{passError}</span>
                            <div className="password-container">
                                <input
                                    type={passwordVisible ? 'text' : 'password'}
                                    id="pass"
                                    placeholder="Password"
                                    name="pass"
                                    value={password}
                                    onChange={(e) => setPassword(e.target.value)}
                                />
                                <span className="toggle-password" onClick={togglePassword}>
                                    <img
                                        src={passwordVisible ? 'assets/eye2.png' : 'assets/eye1.png'}
                                        alt="Show/Hide Password"
                                        id="eye"
                                    />
                                </span>
                            </div>
                            <a href="/forgot-password" className="nyr">Forgot Password?</a>
                            <br /><br />

                            <input type="submit" value="Submit" />
                        </form>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default FacultyLogin;
